import React, {Component} from 'react';
import DailyEntryForm from '../components/DailyEntryForm';

class JournalContainer extends Component {
  render() {
    return(
      <div>
        <h2>Journal Container</h2>
        <DailyEntryForm />
      </div>
    )
  }
}
export default JournalContainer;
